    note = scale[0]
    notes = [note]
    for interval in scale[1:]:
        if interval == '2':
            note = get_notes_from_note(note)[1] # half-tone
        else:
            note = get_notes_from_note(note)[2] # whole-tone
        notes.append(note)
    return notes

